import React from 'react';
import './App.css';
import { Col } from 'react-bootstrap/Col'
import { Row } from 'react-bootstrap/Row'
import { Jumbotron } from 'react-bootstrap/Jumbotron'

function App() {
  return (
    <div>
      <Row>
        <Col md="4">
          <h1 className="title">Conheça os detalhes daquele seu filme favorito!</h1>
          <div className="pipoca"></div>
        </Col>
        <Col md="1"></Col>
        <Col md="6">
        <Jumbotron>
          <h1>Digite o nome do filme.</h1>
          <p>Se preferir você pode visualizar o nosso catálogo de filmes.</p>
          <p><Button variant="primary">Ir para o catálogo</Button></p>
        </Jumbotron>
        </Col>
      </Row>

    </div>
  );
}

export default App;
